import { GETALL } from '../ActionType'
import { endPoints } from '../../API/Endpoint'
import { Api } from '../../API/Api'


export const brandslideraction = (dispatch, payload) => {
    Api.get(endPoints.GET_HOME_PAGE_DATA, payload).then((res) => {

        console.log(res.data.data)
        dispatch({
            type: GETALL,
            payload: res.data.data
        })
    }).catch((err) => { console.log(err) })
}
